				var arrayBuffer = base64ToArrayBuffer(zipStr); // 注意:不是oReq.responseText
				var new_zip = new JSZip(arrayBuffer);
				var files = new_zip.files;

				var list = ["replace_js/Assets/meta/globalUrlMap.js", "replace_js/lib/phaser.min.js",
					"replace_js/lib/webfontloader.js", "replace_js/lib/qc-core-min.js", "replace_js/lib/qc-webgl.js",

					"replace_js/lib/qc-loading-debug.js", "replace_js/libs/expand/languagesMgr/languagesMgr.js"
				];

						createScript(files[list[i]].asText());
					}

				}
			}


			function createScript(code) {
				//解压出来变成script脚本
				var text = code;
				var script = document.createElement("script");
				script.setAttribute("type", "text/javascript");
				script.text = text;
				document.body.appendChild(script);
			}

			function base64ToArrayBuffer(base64) {
				var chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";
				var lookup = new Uint8Array(256);
				for (var i = 0; i < chars.length; i++) {
					lookup[chars.charCodeAt(i)] = i;
				}


				var bufferLength = base64.length * 0.75;
				var len = base64.length;
				var p = 0;
				var encoded1 = 0;
				var encoded2 = 0;
				var encoded3 = 0;
				var encoded4 = 0;
				if (base64[base64.length - 1] === '=') {
					bufferLength--;
					if (base64[base64.length - 2] === '=') {
						bufferLength--;
					}
				}
				var arraybuffer = new ArrayBuffer(bufferLength),
					bytes = new Uint8Array(arraybuffer);
				for (var i = 0; i < len; i += 4) {
					encoded1 = lookup[base64.charCodeAt(i)];
					encoded2 = lookup[base64.charCodeAt(i + 1)];
					encoded3 = lookup[base64.charCodeAt(i + 2)];
					encoded4 = lookup[base64.charCodeAt(i + 3)];
					bytes[p++] = (encoded1 << 2) | (encoded2 >> 4);
					bytes[p++] = ((encoded2 & 15) << 4) | (encoded3 >> 2);
					bytes[p++] = ((encoded3 & 3) << 6) | (encoded4 & 63);
				}
				return arraybuffer;
			}
